import React from 'react';

const CurriculumVitae = () => {
  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-4xl font-bold mb-4">Curriculum Vitae</h1>
      <h2 className="text-2xl font-semibold mb-4">Yoshiyuki Kitaguchi, MD, PhD</h2>
      <p className="mb-4">Email: kitaguchi@yk-gankeisei.com</p>

      <Section title="Education">
        <ul className="list-disc list-inside">
          <li><strong>Osaka University Graduate School of Medicine</strong>, Suita, Japan
            <ul className="list-disc list-inside ml-4"><li>PhD in Ophthalmic Optics, 2004-2009</li></ul>
          </li>
          <li><strong>Osaka University School of Medicine</strong>, Suita, Japan
            <ul className="list-disc list-inside ml-4"><li>MD, 1996-2004</li></ul>
          </li>
        </ul>
      </Section>

      <Section title="Professional Experience">
        <ul className="list-disc list-inside">
          <li><strong>Chief, Senior Consultant (Oculoplastics)</strong>, Department of Ophthalmology, Osaka University Graduate School of Medicine
            <ul className="list-disc list-inside ml-4"><li>Present</li></ul>
          </li>
          <li><strong>Fellowship</strong>, Department of Oculoplastic, Orbital, and Lacrimal Surgeries, Aichi Medical University
            <ul className="list-disc list-inside ml-4"><li>2015-2017</li></ul>
          </li>
          <li><strong>Residency</strong>, Department of Ophthalmology, Osaka National Hospital
            <ul className="list-disc list-inside ml-4"><li>2003-2004</li></ul>
          </li>
          <li><strong>Internship</strong>, Department of Neurosurgery, Osaka University Graduate School of Medicine
            <ul className="list-disc list-inside ml-4"><li>2002</li></ul>
          </li>
        </ul>
      </Section>

      {/* Add more sections as needed */}
    </div>
  );
};

const Section = ({ title, children }) => {
  return (
    <div className="mb-6">
      <h2 className="text-2xl font-semibold mb-3">{title}</h2>
      {children}
    </div>
  );
};

export default CurriculumVitae;
